INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (2.1, 130011, 1, "ヤマト", "2030/01/01 14:59:59", 2, 3001, 100, 3001100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (5.68, 130011, 4, "ヤマト", "2030/01/01 14:59:59", 2, 3001, 101, 3001101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, 130011, 1, "ヤマト", "2030/01/01 14:59:59", 1, 3001, 102, 3001102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, 130211, 1, "フブキ", "2030/01/01 14:59:59", 1, 3002, 100, 3002100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, 130211, 1, "フブキ", "2030/01/01 14:59:59", 1, 3002, 101, 3002101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (8.53, 130211, 5, "フブキ", "2030/01/01 14:59:59", 2, 3002, 102, 3002102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (5.67, 130211, 7, "フブキ", "2030/01/01 14:59:59", 1, 3002, 103, 3002103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, 130211, 1, "フブキ", "2030/01/01 14:59:59", 1, 3002, 104, 3002104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, 130211, 3, "フブキ", "2030/01/01 14:59:59", 3, 3004, 300, 3002300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, 130211, 7, "フブキ", "2030/01/01 14:59:59", 7, 3005, 301, 3002400, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (4.4, 130211, 2, "フブキ", "2030/01/01 14:59:59", 1, 3003, 200, 3003200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, 130211, 7, "フブキ", "2030/01/01 14:59:59", 7, 3003, 201, 3003201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "2024/10/31 12:00:00", -416.5, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (5.6, 130211, 1, "フブキ", "2030/01/01 14:59:59", 2, 3003, 202, 3003202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "2024/10/31 12:00:00", -416.5, 0.0);
